window.bookSummaryJSON = "<p>When the path to victory passes through Hell, all you can do is put on your walking boots.</p> <p>Shem's actions ripped out my heart, but they also bought us time to find the final relic piece.</p> <p>I'm at a loss as to where to look until an encounter with a powerful being promises answers and aid. All I need to do is find my way to Gehenna, the place humans know as Hell.</p> <p>As paths diverge and new goals are set, I know in my heart that this is our last chance to put our world to rights. Our last chance to make Shem's sacrifice count.</p> <p>I can't fail. I won't.</p> <p>Because if I do, it could mean the end of us all.</p> <p>Contains mature themes.</p>"; 
